import React, { Component } from "react";

class Customer extends Component {
  render() {
    return (
      <div>
        <img src={this.props.img} alt={this.props.name}></img>
        <h2>{this.props.name}</h2>
        <p>{this.props.bday}</p>
        <p>{this.props.gender}</p>
        <p>{this.props.job}</p>
      </div>
    );
  }
}

export default Customer;
